const stripePromise = loadStripe(stringPublishableKey);

export default class Pricing extends React.Component {

  constructor(props) {
    super(props);
    this.tooltipRef = React.createRef();
  }

  render() {
    const {
      text,
      tooltipText,
      placement,
      textClass,
      tooltipClass,
    } = this.props;


    return (
      <Popup
        trigger={ <Button color="primary" size="sm"> Add User </Button>}
        modal
        nested
        style={{width:'50%'}}
      >
          {close => (
          <div style={modal}>
            <button className="close" onClick={close}>
               &times;
            </button>
            <div style={modalContent}  className="content">
            <Elements stripe={stripePromise}>
              <StripeForm />
            </Elements>
            </div>
          </div>
        )}
      </Popup>
    );
  }

}
